/* harmony default export */ __webpack_exports__["default"] = ("<ion-header>\n  <ion-toolbar>\n    <ion-buttons slot=\"start\">\n      <ion-back-button defaultHref=\"searchhospitals\"></ion-back-button>\n    </ion-buttons>\n    <ion-title class=\"apphead\">Helpers</ion-title>\n  </ion-toolbar>\n</ion-header>\n\n\n<ion-content>\n\n\t<ion-grid  class='requestgrid' >\n      <ion-row color=\"primary\" justify-content-center class='formcenter'>\n    \n        <ion-col align-self-center size-md=\"12\" size-lg=\"12\" size-xs=\"12\">\n          \t<div class=\"heading\" padding>\n\t           <h3 class=\"termcondition\" color=\"tertiary\">Privacy Policy</h3>\n\t           <p>Last updated in May 2020</p>\n\t        </div>\n          \n          \t<div class=\"content\" padding>\n\n                <h4 class=\"contenth4\" style=\"margin-top: 0;\">The Policy</h4>\n              \t<p>This privacy policy notice is for this app; 'Helpers' and served by Wolfmatrix Limited, 146 Ethelred Court, 1 The Mall, Harrow, HA3 9RJ and governs the privacy of those who use it. The purpose of this policy is to explain to you how we control, process, handle and protect your personal information while browsing or using this app, including your rights under current laws and regulations. If you do not agree to the following policy you may wish to cease viewing / using this website.</p>\n\n              \t<h4 class=\"contenth4\">Policy Key Definitions</h4>\n              \t<ul>\n              \t\t<li>“I”, “our”, “us”, or “we” refer to the business, Human Capital Project Ltd.</li>\n              \t\t<li>“you”, “the user” refer to the person(s) using this website.</li>\n              \t\t<li>GDPR means General Data Protection Act.</li>\n              \t\t<li>PECR means Privacy & Electronic Communications Regulation.</li>\n              \t\t<li>Cookies mean small files stored on a user's computer or device.</li>\n              \t</ul>\n              \t\n              \t<h4 class=\"contenth4\">Processing of your Personal Data</h4>\n\n              \t<p>Under the GDPR (General Data Protection Regulation) we control and / or process any personal information about you electronically using the following lawful bases. Lawful basis: Consent, Legitimate interests</p>\n\n              \t<p>We process your information in the following ways: Communication related to your activity on the app, your account and activity messages.</p>\n\n              \t<p>Data retention period: We will continue to process your information under this basis until you withdraw consent or it is determined your consent no longer exists.</p>\n\n              \t<p>Sharing your information: We do not share your information with third parties without your permission. Your name, city name, photo and public activity on the site will be visible to other members of the site.</p>\n\n              \t<p>If, as determined by us, the lawful basis upon which we process your personal information changes, we will notify you about the change and any new lawful basis to be used if required. We shall stop processing your personal information if the lawful basis used is no longer relevant.</p>\n\n              \t<h4 class=\"contenth4\">Your Individual Rights</h4>\n\n              \t<p>Under the GDPR your rights are as follows.</p>\n\n              \t<ul>\n              \t\t<li>the right to be informed;</li>\n              \t\t<li>the right of access;</li>\n              \t\t<li>the right to rectification;</li>\n              \t\t<li>the right to erasure;</li>\n              \t\t<li>the right to restrict processing;</li>\n              \t\t<li>the right to data portability;</li>\n              \t\t<li>the right to object; and</li>\n              \t\t<li>the right not to be subject to automated decision-making including profiling.</li>\n              \t</ul>\n              \t<p>You also have the right to complain if you feel there is a problem with the way we are handling your data. We handle subject access requests in accordance with the GDPR.</p>\n\n              \t<h4 class=\"contenth4\">Data Security and Protection</h4>\n              \t<p>We ensure the security of any personal information we hold by using secure data storage technologies and precise procedures in how we store, access and manage that information. Our methods meet the GDPR compliance requirement.</p>\n\n              \t<h4 class=\"contenth4\">Use of cookies</h4>\n              \t<p>A cookie is a small data file that is sent to your computer or other electronic devices from a website and is stored on your device's hard drive when you visit that website. There are different types of cookies which are used to do different things. These include letting you navigate between different pages on a website efficiently, remembering preferences you have given and helping us to identify ways to improve your overall site experience. Others are used to provide you with advertising which is more tailored to your interests or to measure the number of site visits and the most popular pages users visit. Cookies cannot be used to identify you personally.</p>\n\n              \t<p>Generally, there are two different types of browser cookie, session cookies which are stored in the computer's memory during a user's browsing session and are automatically deleted from your computer when the browser is closed or the session is deemed to have ended; and persistent cookies which are stored on the user's computer and are not deleted when the browser is closed. Persistent cookies can be used to retain user preferences for a particular website, allowing those preferences to be used in future browsing sessions.</p>\n\n              \t<p>We and our partners (such as Google) do store cookies in your browser. These enable us to remember your preferences and settings and accurately gather aggregate, anonymised data about how our website and apps are used. For example, we use cookies to detect whether you’ve visited our website before, and remember information you may have previously provided us with, such as postcode. We also use cookies to help us compile aggregate data about site traffic and site interaction so that we can offer better site experiences and tools in the future.</p>\n\n              \t<p>We use cookies and beacons to:</p>\n              \t<ul>\n              \t\t<li>understand and save user's preferences for future visits; and</li>\n              \t\t<li>compile aggregate data about site traffic and site interactions in order to offer better site experiences and tools in the future. We may also use trusted third-party services that track this information on our behalf. All event data captured by Google Analytics is automatically deleted after 14 months.</li>\n              \t</ul>\n\n              \t<p>The cookies and beacons utilised in the Helpers app and site are all first party cookies (such as the Google Analytics cookies which is where a small amount of text is stored in a user's computer which is created by the website that the user is visiting). Users may opt out of receiving app and website functionality reliant on Google Analytics by following instructions on the Google website. Users may also use cookie-blocking browser extensions such as UBlock, AdBlock, or Ghostery.</p>\n\n              \t<h4 class=\"contenth4\">How to control and delete cookies</h4>\n              \t<p>If you wish to restrict or block the cookies which are set by our website you can do this through your browser settings. The 'help' function within your browser should tell you how. Alternatively, you may wish to visit www.aboutcookies.org which contains comprehensive information on how to control and delete cookies.</p>\n\n              \t<p>Please be aware that restricting cookies may impact on the functionality of our website. If you wish to view your cookie code, just click on a cookie to open it. You'll see a short string of text and numbers. For information on how to do this on the browser of your mobile phone you will need to refer to your handset manual.</p>\n          \t\n              \t<h4 class=\"contenth4\">Email Marketing Messages, Notifications & Subscription</h4>\n              \t<p>Under the GDPR we use the consent lawful basis for anyone subscribing to our newsletter or marketing mailing list. We only collect certain data about you, as detailed in the “Processing of your personal data” above.</p>\n\n              \t<p>Any email marketing messages we send are in accordance with the GDPR and the PECR. We provide you with an easy method to withdraw your consent (unsubscribe) or manage your preferences / the information we hold about you at any time. See any marketing messages for instructions on how to unsubscribe or manage your preferences.</p>\n\n              \t<p>We also send transactional emails and app notifications related to your activity on the app. You can control these notifications from within your account settings.</p>\n\n              \t<h4 class=\"contenth4\">Links to Other Sites</h4>\n              \t<p>Our Service may contain links to other sites that are not operated by us. If you click on a third party link, you will be directed to that third party’s site. We strongly advise you to review the Privacy Policy of every site you visit.</p>\n\n              \t<p>We have no control over, and assume no responsibility for the content, privacy policies or practices of any third party sites or services.</p>\n\n              \t<h4 class=\"contenth4\">Children’s Privacy</h4>\n              \t<p>Our Service does not address anyone under the age of 18 (“Children”).</p>\n\n              \t<p>We do not knowingly collect personally identifiable information from children under 18. If you are a parent or guardian and you are aware that your Children have provided us with Personal Information, please contact us. If we discover that anyone under the age of 18 has provided us with Personal Information, we will delete such information from our servers immediately.</p>\n\n              \t<h4 class=\"contenth4\">Data Controller</h4>\n              \t<p>Wolfmatrix Limited are data controllers of the data collected by Helpers. This means that they are responsible managing and protecting it. They do not at this time process any personal data in relation to the use of Helpers. Furthermore, they have no plans to do.</p>\n\n              \t<p>The Helpers app and website may request your postcode from time to time in order to deliver you with relevant local content. This postcode never leaves your device, and is not transmitted back to the website/app operators or developers. Similarly, if you choose to enable location services in the Helpers app, your location will first be ‘fuzzed’ and offset, before being transmitted to the Helpers servers. Once on the Wolfmatrix Limited servers, this obfuscated location will be automatically deleted as soon as your results have been returned.</p>\n\n              \t<h4 class=\"contenth4\">How we protect your data</h4>\n              \t<p>Wolfmatrix Limited take the security of your data seriously. No personal data leaves your device through the Helpers app. In any event, both the operators and developers of the app have put in place suitable physical, electronic and managerial procedures to safeguard and secure the information they work with online in order to prevent unauthorised access or disclosure to connected systems.</p>\n\n              \t<p>Information on Helpers usage is only made available to Wolfmatrix Limited in an aggregate and anonymised format. This means that we only get a summary of information on Helpers usage and cannot monitor individual users.</p>\n\n              \t<h4 class=\"contenth4\">Management of your data</h4>\n\n              \t<p>Responsibility for managing Helpers app data rests within Wolfmatrix Limited. They conform to the General Data Protection Regulations and cannot access any personal data on you.</p>\n\n              \t<p>As app usage data is only stored in aggregate format it may be impossible to delete individual users’ records as these are not identifiable (https://support.google.com/analytics/answer/7667196?hl=en)</p>\n\n              \t<h4 class=\"contenth4\">What if I do not want my information used by Helpers app?</h4>\n              \t<p>If somebody else has physical access to your device, they may be able to identify you from the information you enter in-app. Wolfmatrix Limited collected some data (first name, last name, email, phone, postcode or hospital name) to serve you the required information. This data can be asked to remove from our server anytime you wish by emailing us on info@helpournhs.com. </p>\n\n        \t\t\t\t<h4 class=\"contenth4\">Changes</h4>\n        \t\t\t\t<p>We reserve the right, at our sole discretion, to modify or replace this Policy at any time. If a revision is material we will try to provide at least 30 days notice prior to any new terms taking effect. What constitutes a material change will be determined at our sole discretion.</p>\n\n\t\t\t\t        <p>By continuing to access or use our Service after those revisions become effective, you agree to be bound by the revised policy. If you do not agree to the new policy, please stop using the Service. You are advised to review this policy periodically for any changes. Changes to this policy are effective when they are posted on this page.</p>\n\n\t\t\t\t<h4 class=\"contenth4\">Other</h4>\n\t\t\t\t<p>The Service uses the NHS API(s), therefore by using the Service, you are subject to the NHS Privacy Policy. </p>\n\n\t\t\t\t<p>Where data is collected by Google Analytics, it is done so under Google’s Analytics Data Processing Terms, and under clause 10 of the terms (accessible at https://privacy.google.com/businesses/processorterms/. All processing by third parties will be done in accordance with the Privacy Shield frameworks they have established.</p>\n\n\t\t\t\t<p>Data collected provides anonymised insight into user usage of Helpers as well as performance issues, bugs, and crashes which may occur from time-to-time. This anonymised data is used to improve Helpers and prioritise new and existing content that is recognised as of interest to the app’s audience as a whole. Individual users cannot be identified from this information alone.</p>\n\n\t\t\t\t<h4 class=\"contenth4\">Contact Us</h4>\n\t\t\t\t<p>If you have any questions about this Privacy Policy, please contact us at info@helpournhs.com subject ‘Privacy Policy’.</p>\n\n          \t</div>\n\n        </ion-col>\n      </ion-row>\n    </ion-grid>\n\n</ion-content>\n");

